import React from "react";
import "../Layout.css";

function About() {
  return (
    <div className="page-container">
      <div className="outer-card">
        <h1>Om oss</h1>
        <div className="inner-card">
          <p style={{ fontWeight: 600, wordWrap: "break-word", overflowWrap: "break-word" }}>
            Kumla Sportfiske är en organisation som arbetar för ett hållbart sportfiske inom Kumla kommun.
            Vi har två sjöar med fiskekort och en medlemssjö för medlemmar.
          </p>
        </div>
      </div>
    </div>
  );
}

export default About;
